import React, { useState } from 'react'
import MenuItem from '../menu-item/MenuItem'

const menubar = [
  {
    name: 'Pizza',
    price: '40.99'
  },
  {
    name: 'Burger',
    price: '12.99'
  }
]

const MenuList = () => {

  return (
    <div className='menu_container'>
      {menubar.map((menuitem) => {
         return (
           <MenuItem item={menuitem} />
         )})}
    </div>

  )
}

export default MenuList
